    .switch {
  position: relative;
  display: block;
  vertical-align: top;
  width: 100px;
  height: 30px;
  padding: 3px;
  margin: 0 10px 10px 0;
  background: linear-gradient(to bottom, #eeeeee, #FFFFFF 25px);
  background-image: -webkit-linear-gradient(top, #eeeeee, #FFFFFF 25px);
  border-radius: 18px;
  box-shadow: inset 0 -1px white, inset 0 1px 1px rgba(0, 0, 0, 0.05);
  cursor: pointer;
}
.switch-input {
  position: absolute;
  top: 0;
  left: 0;
  opacity: 0;
}
.switch-label {
  position: relative;
  display: block;
  height: inherit;
  font-size: 10px;
  text-transform: uppercase;
  background: #eceeef;
  border-radius: inherit;
  box-shadow: inset 0 1px 2px rgba(0, 0, 0, 0.12), inset 0 0 2px rgba(0, 0, 0, 0.15);
}
.switch-label:before, .switch-label:after {
  position: absolute;
  top: 50%;
  margin-top: -.5em;
  line-height: 1;
  -webkit-transition: inherit;
  -moz-transition: inherit;
  -o-transition: inherit;
  transition: inherit;
}
.switch-label:before {
  content: attr(data-off);
  right: 11px;
  color: #2F2F2F;
  text-shadow: 0 1px rgba(255, 255, 255, 0.5);
}
.switch-label:after {
  content: attr(data-on);
  left: 11px;
  color: #FFFFFF;
  text-shadow: 0 1px rgba(0, 0, 0, 0.2);
  opacity: 0;
}
.switch-input:checked ~ .switch-label {
  background: #4B7F63;
  border-color: #4B7F63;
  box-shadow: inset 0 1px 2px rgba(0, 0, 0, 0.15), inset 0 0 3px rgba(0, 0, 0, 0.2);
}
.switch-input:checked ~ .switch-label:before {
  opacity: 0;
}
.switch-input:checked ~ .switch-label:after {
  opacity: 1;
}
.switch-handle {
  position: absolute;
  top: 4px;
  left: 4px;
  width: 28px;
  height: 28px;
  background: linear-gradient(to bottom, #FFFFFF 40%, #f0f0f0);
  background-image: -webkit-linear-gradient(top, #FFFFFF 40%, #f0f0f0);
  border-radius: 100%;
  box-shadow: 1px 1px 5px rgba(0, 0, 0, 0.2);
}
.switch-handle:before {
  content: "";
  position: absolute;
  top: 50%;
  left: 50%;
  margin: -6px 0 0 -6px;
  width: 12px;
  height: 12px;
  background: linear-gradient(to bottom, #eeeeee, #FFFFFF);
  background-image: -webkit-linear-gradient(top, #eeeeee, #FFFFFF);
  border-radius: 6px;
  box-shadow: inset 0 1px rgba(0, 0, 0, 0.02);
}
.switch-input:checked ~ .switch-handle {
  left: 74px;
  box-shadow: -1px 1px 5px rgba(0, 0, 0, 0.2);
}
    </style>

        // scaling the thickness of the edges
        function scale(oldval, nums){
        var oldmax = Math.max.apply(Math, nums);
        var oldmin = Math.min.apply(Math, nums);
        var newmax = 5
        var newmin = 0.5
        var oldrange = (oldmax - oldmin)
        var newrange = (newmax - newmin)
        // oldmax = 7000
        //oldmin = 1000
        //
        var newval = (((oldval - oldmin) * newrange) / oldrange) + newmin

        return newval
        }



        function animateTicket(){


        var result = document.getElementsByClassName("switch-input")[0].checked ? 'Relative' : 'Absolute'
    abs_rel(result)

        location.reload();

    }
            var edge_dict = {}

            // create a dictionary of the edge name of the edge to the corresponding path string
            for (var e = 0; e < edge_list.length; e++) {
                selected_edge = edge_list[e]
                edge_dict[selected_edge.__data__.key] = selected_edge;

            }

            mainPathList = []

            //iterate through the list of ids and create lists of paths and durations

            for (var id = 0; id < ticket_json.length; id++){
                var path_dict = ticket_json[id];
                // console.log(path_dict)
                var path_name = path_dict["origin"] + "->" + path_dict["destination"]
                var edge_path = edge_dict[path_name]

                if (edge_path){

                        new_begin = begin_arr[id]
                        new_end = end_arr[id]
                        // var duration = path_dict["duration"]
                    var duration = new_end - new_begin

                    var path_str = edge_path.innerHTML.split("d=\"")[1].split("\" class=")[0]
                    var delay = new_begin

                    temp = {path: path_str, dur: duration, name:path_name, delay: delay, id: path_dict['ticket_id'] , size: path_dict["size"]}
                    mainPathList.push(temp)

                }


            }

            // first_path = bounded_pathlist.slice(0,1)
            var path_div = d3.select("svg").append("div").attr("class", "path_div")

            //create circles and bind data
            var circles = d3.select("#graph0").selectAll("circle")
                                .data(mainPathList)
                                .enter()
                                .append("circle")
                                .attr("fill", "red")
                                //   .attr('r', 5)

                                .attr('r', function (d) {
                                    temp = scalecircles(d.size)
                                    //   console.log(d.size)
                                    //   console.log(temp)
                                    //   console.log
                                    //   console.log(scalecircles(d.size))
                                    return (temp)
                                    })
                                    .attr("visibility", "hidden")



            var counter =  0



                // function to get and return points along the path
            function pathTween(path){
                // console.log(d)
                var l = path.node().getTotalLength(); // Get the length of the path
                // var r = d3.interpolate(0, length); //Set up interpolation from 0 to the path length
                return function(t){
                    var point = path.node().getPointAtLength(t*l); // Get the next point along the path
                    d3.select(this) // Select the circle
                    .attr("visibility", "visible")
                        .attr("cx", point.x) // Set the cx
                        .attr("cy", point.y) // Set the cy
                        // console.log(d)
                }
                // console.log(d)
            }

            transition()

            // move through the paths and durations of each ticket using a counter and set up the transition
            function transition() {
                d3.selectAll('circle')
                .transition()

                .delay(function(d){
                    return d.delay})
                .duration(function(d){
                    return d.dur; })
                    .ease(d3.easeLinear)

                .tween("pathTween", function(d){
                    // console.log(d)
                    // if (d.path)
                    // {
                        path = path_div.append('path')

                        .attr('d',d.path)
                        .attr('fill', 'red')
                        // update(d, path)
                        // console.log(path.attr("d"))
                    // console.log(d.paths[counter])
                    return pathTween(path)
                    // }
                })

                    .remove();
            }
            trial = trial + 1
        }
